        "#Bubble_sort\n",
        "# Time complexity: O(n2)\n",
        "# Space complexity: O(1)\n",
        "def sort(arr):\n",
        "  n=len(arr)\n",
        "  for j in range(n-1,0,-1):\n",
        "    for i in range(j):# iterate j no. of times\n",
        "      if arr[i]>arr[i+1]:\n",
        "        arr[i],arr[i+1]=arr[i+1],arr[i]\n",
        "\n",
        "a=[2,4,5,3,7,6]\n",
        "sort(a)\n",
        "a\n"
