        "# Quick Sort\n",
        "def selection_sort(arr):\n",
        "  for i in range(len(arr)-1):\n",
        "    min_idx=i\n",
        "    # print(min_idx)\n",
        "    for j in range(i+1,len(arr)):\n",
        "      if arr[j]<arr[min_idx]:\n",
        "        min_idx=j\n",
        "\n",
        "    arr[i],arr[min_idx]=arr[min_idx],arr[i]\n",
        "\n",
        "a=[2,4,5,3,7,6]\n",
        "selection_sort(a)\n",
        "print(a)\n"
