        "def delete(self,data):\n",
        "  if self.key is None:\n",
        "    print(\"Tree is empty\")\n",
        "    return\n",
        "  if data<self.key:\n",
        "    if self.lchild:\n",
        "      self.lchild = self.lchild.delete(data)\n",
        "    else:\n",
        "      print(\"Node is not present in the tree\")\n",
        "  elif data>self.key:\n",
        "    if self.rchild:\n",
        "      self.rchild = self.rchild.delete(data)\n",
        "    else:\n",
        "      print(\"Node is not present in the tree\")\n",
        "  else:\n",
        "    if self.lchild is None:\n",
        "      temp=self.rchild\n",
        "      self=None\n",
        "      return temp\n",
        "    if self.rchild is None:\n",
        "      temp=self.lchild\n",
        "      self=None\n",
        "      return temp\n",
        "    node=self.rchild #Right-child\n",
        "    while node.lchild:# nose with the smallest k in the right child\n",
        "      node=node.lchild#Left-child\n",
        "    self.key = node.key\n",
        "    self.rchild = self.rchild.delete(node.key)\n",
        "  return self"
